import React from "react";

const NotFound = () => {
  return (
    <div style={{ color: "#72ffff", background: "#303040", width: "50%" }}>
      <h1 className="centered">404</h1>
      <img src="images/tardis.gif" alt="tardis" className="centered" />
      <h3 className="centered">Page not found!</h3>

      <h3 className="centered">
        <em style={{ marginRight: "15px" }}>TRANSFORM</em> your url to match one
        of the site pages
      </h3>
    </div>
  );
};

export default NotFound;
